import React from 'react';

const App = () => {

  const recherche = () => {

    fetch('http://locahost' , {
      body
    })

    return console.log('cool recherche');
  }

  return(

    <div>
        <h2>Salut tous le monde</h2>
        { recherche() }
    </div>
  )
}

export default App;
